	return (
		<nav>
			<ul className="flex-row">
				{navLinks.map((tab) => (
					<li className="mx-1" key={tab}>
						<span
							onClick={() => {
								setCurrentNavLink(tab);
								console.log(currentNavLink);
							}}
						>
							{tab}
						</span>
					</li>
				))}
			</ul>
		</nav>
	);
}

export default Nav;
